import { useEffect } from "react"
import './css/moves.css';
import BattleIcon from "./icon/BattleIcon";
import Halftone from "./Halftone";

export default function Moves({pokemon}) {

    useEffect(() => {
        console.log(pokemon.moves)
    }, [pokemon])

    return (
        <Table 
            title={"Moves"}
            moves={pokemon.moves}/>
    )
}

function Table({title, moves}) {

    return (
        <table>
            <thead>
                <tr>
                    <th>
                        <Halftone 
                            styles="card"
                            color={pokemon.role}/>
                        <div className="table-header">
                            <BattleIcon />
                            <p>{title}</p>
                        </div>
                    </th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>{}</td>
                    <td>Maria Anders</td>
                </tr>
                <tr>
                    <td>Centro comercial Moctezuma</td>
                    <td>Francisco Chang</td>
                </tr>
            </tbody>
        </table>
    )
}
